   // EDITAR CUBICACIN\n    if (action.type === cubicacionActions.editCubicacionSuccess.type) {\n      this.snackMessage.showMessage(\n        `Cubicacin ID:${action.response.data.cubicacion_id} editada con exito`,\n        'Exito',\n        6000\n      );\n      this.router.navigate(['/cubicacion/list-cub']);\n    }\n\n    // CLONAR CUBICACIN\n    if (action.type === cubicacionActions.clonarCubicacionSuccess.type) {\n      this.snackMessage.showMessage(\n        `Clonacin realizada con xito. Nueva Cubicacin ID:${action.response.data.cubicacion_id}`,\n        'Exito',\n        6000\n      );\n      this.cubicacionFacade.listarCubicaciones();\n    }\n\n    // ELIMINAR CUBICACIN\n    if (action.type === cubicacionActions.eliminarCubicacionSuccess.type) {\n      this.snackMessage.showMessage(\n        `Cubicacin ID:${action.response.data.cubicacion_id} eliminada con exito`,\n        'Exito',\n        6000\n      );\n      this.cubicacionFacade.listarCubicaciones();\n    }\n\n    // ELIMINAR SERVICIO CARRITO\n    if (action.type === cubicacionActions.eliminarServicioCarritoSuccess.type) {\n      this.snackMessage.showMessage(`Eliminacin exitosa`, 'Exito', 6000);\n    }\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/Actividad.html":{"url":"interfaces/Actividad.html","title":"interface - Actividad","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  \n  Actividad\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/core/model/servicio.ts\n        \n\n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                   